import {useEffect, useState} from "react";

function Photos() {

    useEffect(() => {
        fetchItems();
    }, []);

    const [photos, setPhotos] = useState([]);

    const fetchItems = async () => {
        const data = await fetch(
            'https://jsonplaceholder.typicode.com/albums/1/photos'
        );

        const photos = await data.json();
        setPhotos(photos)
    }

    return (
        <div>
            <h1 className="mb-4">Photos page</h1>

            <div className="d-flex row col-md-10 mx-auto align-items-center text-center">

                {photos.map(photo => (
                    <div className="d-flex col-md-3">
                        <span className="">
                            <img className="img-fluid img-thumbnail" alt={`gallery${photo.id}`} src={`${photo.url}`} />
                        </span>
                        <a href={photo.url}>
                            <img src={photo.thumbnailUrl}></img>
                        </a>
                        <p>{photo.title}</p>
                    </div>                    
                ))}
            </div>

        </div>
    );
}

export default Photos;
